  return (
    <div>
        <BrowserRouter>
                  <Switch>
                    <Route exact path='/' component={AdminRout}  />
                    <Route exact path='/signin' component={LogIn}  />

                    <Route component={NotFound} />

                  </Switch>
        </BrowserRouter>
    </div>
  );
}

function NoMatch() {
